import "./Tours.css";

function Tours({tours})
{
return (
    <div>

        <div>
            <h2>Plan Tour With Hammir</h2>
        </div>

        <div>
            {
                tours.map( (tour) =>{
                    return <Card {...tour}></Card>
                }
                )
            }
        </div>




    </div>
)
}

export default Tours;
